import React from 'react';
import Login from './component/Login/Login'
import './App.css'
import Users from './component/Users/Users'
import {Link,Switch,Route} from 'react-router-dom'

function App() {
  return (
      <div className="App">
        <Route path="/login" component={Login}/>
      </div>
  );
}

export default App;
